import { Link } from "react-router-dom";
const Navbar =()=>{
    return(
        <nav className="navbar">
            <h1>The 3ple Blog</h1>
            <div className="link">
                <Link to="/">Home</Link>
                <Link to="/create">New Blog</Link>
            </div>
        </nav>
    )
}
export default Navbar;
